import React from 'react';
import {Row} from "react-bootstrap";
import {DateRangePicker} from "rsuite"
import 'rsuite/dist/rsuite.css'

const OrderFilter = () => {
    return (
        <Row>
            <div>
                Період
                <DateRangePicker
                    size="lg"
                    appearance="subtle"
                    placeholder="Оберіть період"
                    style={{ width: 200 }}
                >

                </DateRangePicker>
            </div>
        </Row>
    );
};

export default OrderFilter;
